var fileJSON=[{"path":"/home/ania/git_ref_v0/gridding_kernels.cl", "name":"gridding_kernels.cl", "has_active_debug_locs":true, "absName":"/home/ania/git_ref_v0/gridding_kernels.cl", "content":"/*__kernel void vector_add(__global const int *A, __global const int *B, __global int *C) {\012 \012    // Get the index of the current element to be processed\012    int i = get_global_id(0);\012 \012    // Do the operation\012    C[i] = A[i] + B[i];\012}\012*/\012\012#ifndef EMULATOR\012#define EMULATOR 0\012#endif\012\012__attribute__((max_global_work_dim(0)))\012__kernel void oskar_grid_wproj_cl(\012        int num_w_planes,\012        __global const int* restrict support,\012        const int oversample,\012        const int conv_size_half,\012        __global const float* restrict conv_func,\012        const int num_points,\012        __global const float* restrict uu,\012        __global const float* restrict vv,\012        __global const float* restrict ww,\012        __global const float* restrict vis,\012        __global const float* restrict weight,\012        const float cell_size_rad,\012        const float w_scale,\012        const int trimmed_grid_size,\012        const int grid_size,\012		const int grid_topLeft_x, const int grid_topLeft_y,\012        __global float* restrict grid)\012{\012\012\012    int i;\012    const int kernel_dim = conv_size_half * conv_size_half;\012    const int grid_centre = grid_size / 2;\012    const float grid_scale = grid_size * cell_size_rad;\012\012    float norm=0;\012\012    \012    /* Loop over visibilities. */\012    int num_skipped = 0;\012    for (i = 0; i < num_points; ++i)\012    //for (i = 0; i < 100000; ++i)\012    {\012        #if EMULATOR > 0\012            if ((i%1000) == 0) printf(\"i: %d\\n\", i);\012        #endif\012\012        double sum = 0.0;\012        int j, k;\012\012        /* Convert UV coordinates to grid coordinates. */\012        const float pos_u = -uu[i] * grid_scale;\012        const float pos_v = vv[i] * grid_scale;\012        const float ww_i = ww[i];\012        const float conv_conj = (ww_i > 0.0f) ? -1.0f : 1.0f;\012        const int grid_w = (int)round(sqrt(fabs(ww_i * w_scale)));\012        //printf(\"grid_w: %d, ww_i %f\\n\", grid_w, ww_i);\012        //const int grid_w = 2;\012        const int grid_u = (int)round(pos_u) + grid_centre - grid_topLeft_x;\012        const int grid_v = (int)round(pos_v) + grid_centre - grid_topLeft_y;\012\012        /* Get visibility data. */\012        // hard code weight value to 1.0\012        const float weight_i = 1.0;\012        # if FAKE_VIS_VALUES==1\012        const float v_re = 1.0;\012        const float v_im = 0.0;\012        # else\012        const float v_re = weight_i * vis[2 * i];\012        const float v_im = weight_i * vis[2 * i + 1];\012        # endif\012\012        /* Scaled distance from nearest grid point. */\012        const int off_u = (int)round((round(pos_u) - pos_u) * oversample);\012        const int off_v = (int)round((round(pos_v) - pos_v) * oversample);\012\012        /* Get kernel support size and start offset. */\012        const int w_support = grid_w < num_w_planes ?\012                support[grid_w] : support[num_w_planes - 1];\012\012        //const int w_support = 4;\012        const int kernel_start = grid_w < num_w_planes ?\012                grid_w * kernel_dim : (num_w_planes - 1) * kernel_dim;\012\012        //printf(\"grid_u %d, grid_size %d\\n\", grid_u, grid_size);\012        /* Catch points that would lie outside the grid. */\012        if (grid_u + w_support >= trimmed_grid_size || grid_u - w_support < 0 ||\012                grid_v + w_support >= trimmed_grid_size || grid_v - w_support < 0)\012        {\012            num_skipped += 1;\012            continue;\012        }\012\012        /* Convolve this point onto the grid. */\012        for (j = -w_support; j <= w_support; ++j)\012        {\012            int p1, t1;\012            p1 = grid_v + j;\012            p1 *= trimmed_grid_size; /* Tested to avoid int overflow. */\012            p1 += grid_u;\012            t1 = abs(off_v + j * oversample);\012            t1 *= conv_size_half;\012            t1 += kernel_start;\012            for (k = -w_support; k <= w_support; ++k)\012            {\012                int p = (t1 + abs(off_u + k * oversample)) << 1;\012                # if FAKE_KERNEL_VALUES==1\012                const float c_re = 1.0;\012                const float c_im = 0.0;\012                # else\012                const float c_re = conv_func[p];\012                const float c_im = conv_func[p + 1] * conv_conj;\012                # endif\012                p = (p1 + k) << 1;\012                grid[p]     += (v_re * c_re - v_im * c_im);\012                grid[p + 1] += (v_im * c_re + v_re * c_im);\012                //if (c_re>0) printf(\"grid: %.15f %.15f\\n\", grid[p], v_re * c_re - v_im * c_im);\012                sum += c_re; /* Real part only. */\012            }\012                                                                }\012        norm += sum * weight_i;\012    }\012}\012"}];